import React from "react";
import { Navbar } from 'react-bootstrap';
import { Nav } from "react-bootstrap";
import { Form } from "react-bootstrap";
import { AiOutlineSearch } from 'react-icons/ai';
import { AiOutlineUser } from 'react-icons/ai';
import { AiOutlineShopping} from 'react-icons/ai';
import { FaWhatsapp} from 'react-icons/fa';
import { FormControl } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./css/navmenu.css";
import logo from "./images/NYKD_logos.png"

class NavMenu extends React.Component{
    render(){
        return(
            <div>
                <div class="textfi">
                 <p>The Big Indian Toy Sale is now live. Get upto 50% off your favorite toys, games and collectibles. </p>
                </div>
                <div class="conatiner-fluid">
                <nav>
                    <Navbar bg="light" expand="lg">
                        <Navbar.Brand href="#home"><img src={logo} alt="logo" ></img></Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="mr-auto">
                            <Nav.Link href="#home">Categories</Nav.Link>
                            <Nav.Link href="#link">Brand</Nav.Link>
                            <Nav.Link href="#link">Character</Nav.Link>
                            <Nav.Link href="#link">Gift Registry</Nav.Link>
                            <Nav.Link href="#link">FunLab</Nav.Link>
                            <Nav.Link href="#link">Contact Us</Nav.Link>
                            </Nav>
                            <Form inline >
                            <span class="icon"><AiOutlineSearch size="25px"/></span>
                            <FormControl type="text" placeholder="Search here" className="mr-sm-2" />
                            </Form>
                            <span class="icon"><FaWhatsapp size="30px"/></span>
                            <span class="icon"><AiOutlineUser size="30px"/></span>
                            <span class="icon"><AiOutlineShopping size="30px"/></span>
                        </Navbar.Collapse>
                        </Navbar>
                    </nav>
                </div>
            </div>
)
    }
}
export default NavMenu;
